Капот советского автомобиля покрытого ржавчиной. На капоте фигурка из керамики в виде клоуна с отбитыми частями, царапинами, трещинами. На голове у клоуна два дорожных конуса. Пасмурная погода, капли дождя блестят на капоте. Цвета оттенков мороженного: нежные ванильный, розоый, лазурный. Блеклая палитра. Снято на плёночную камеру с зернистой плёнкой  Vision2 250D. 
Под фигуркой клоуна капот покрыт крупным орнаментом из ржавых рукописных букв составляющих текст стихотворения:
"Yesterday in crannies or in nooks you will not find;
Yesterday in chronicles or books you will not find;
All you see of yesterday is shadows in your mind;
Shadows on the pavement but no bodies do you find"
этот текст крупно покрывает весь капот и виден в перспективе, фигурка клоуна загораживает часть текста.
